import "./MenuTopRight.css";

function MenuTopRight() {
    return (
        <div className="top-right">
            <h1>Pancake</h1>
            <h6>Млечно - Бело - Темно чоколадо, банана, јагода, пченично брашно, путер, млеко, квасец, сол, шеќер, јајца, ванилин, вода.</h6>

        </div>
    )
}

export default MenuTopRight;
